import React, {useState, useEffect} from "react";
import axios from 'axios';
import Baked from "./img/lm4rceme60edquisbnwb.jpeg";
import "./css/Homepage.css";

function Homepage() {

    const [recipes, getRecipes] = useState('');

    useEffect(() => {
        getAllRecipes()
    });

    function getAllRecipes() {
        axios.get("http://localhost:8080/api/recipes")
            .then(response => {
                console.log(response.data)
                if (response.data != null) {
                    const allRecipes = response.data
                }
            });

        return (
            <RecipeList recipes={recipes}/>
        )
    }

    return (
        <div>

            <div className="card-food" key={recipes.id}>
                <img src={Baked} alt={"Baked"} className="card-img-top"/>
                <div className="card-body">
                    <h5 className="card-title">{recipes.title}</h5>
                    <p className={"card-text"}>{recipes.meal}</p>
                </div>
            </div>
        </div>
    )
}

export default Homepage;
